const atob = require('atob');
const Blob = require('node-blob');
const botella_image = ''
const vidrio_image = ''
const paper_image = ''
const metal_image =''
const b64toBlob = (b64Data, contentType = '', sliceSize = 512) => {
    const byteCharacters = atob(b64Data);
    const byteArrays = [];
    for (let offset = 0; offset < byteCharacters.length; offset += sliceSize) {
        const slice = byteCharacters.slice(offset, offset + sliceSize);
        const byteNumbers = new Array(slice.length);
        for (let i = 0; i < slice.length; i++) {
            byteNumbers[i] = slice.charCodeAt(i);
        }
        const byteArray = new Uint8Array(byteNumbers);
        byteArrays.push(byteArray);
    }
    return new Blob(byteArrays, {type: contentType});
};
const botellaBlob = b64toBlob(botella_image, 'image/webp');
const glassBlob = b64toBlob(vidrio_image, 'image/jpeg');
const paperBlob = b64toBlob(paper_image, 'image/jpeg');
const metalBlob = b64toBlob(metal_image,'image/jpeg');

exports.seed = function (knex, Promise) {
    // Deletes ALL existing entries
    return knex('corporations.products').del()
        .then(function () {
            // Inserts seed entries
            return knex('corporations.products').insert([
                {
                    name: 'Botella',
                    description: 'Plastico',
                    unit:'unidad',
                    image: botellaBlob.buffer,
                    imageType: 'image/jpeg'
                },
                {
                    name: 'Aluminio',
                    description: 'Metales variados o electrodomesticos',
                    unit:'Kilogramos',
                    image: metalBlob.buffer,
                    imageType: 'image/jpeg'
                },
                {
                    name: 'Vidrio',
                    description: 'Plastico',
                    unit:'Kilogramos',
                    image: glassBlob.buffer,
                    imageType: 'image/jpeg'
                },
                {
                    name: 'Papel',
                    description: 'papel, carton,etc',
                    unit:'kilogramos', 
                    image: paperBlob.buffer,

                    imageType: 'image/jpeg'
                },
            ]);
        });
};
